package com.google.crypto.tink.signature.internal.testing;

import static java.util.Arrays.stream;

import com.google.crypto.tink.AccessesPartialKey;
import com.google.crypto.tink.InsecureSecretKeyAccess;
import com.google.crypto.tink.signature.SlhDsaParameters;
import com.google.crypto.tink.signature.SlhDsaParameters.Variant;
import com.google.crypto.tink.signature.SlhDsaPrivateKey;
import com.google.crypto.tink.signature.SlhDsaPublicKey;
import com.google.crypto.tink.subtle.Hex;
import com.google.crypto.tink.util.Bytes;
import com.google.crypto.tink.util.SecretBytes;
import java.security.GeneralSecurityException;
import java.util.stream.Stream;

/** Test utilities for SLH-DSA. */
@AccessesPartialKey
public final class SlhDsaTestUtil {
  public static Stream<SignatureTestVector> createSlhDsaValidSignatureTestVectors() {
    // Keys and message from tcId 424 of
    // https://raw.githubusercontent.com/usnistgov/ACVP-Server/refs/heads/master/gen-val/json-files/SLH-DSA-sigVer-FIPS205/internalProjection.json,
    // signature value generated with third_party/tink/go/internal/signature/slhdsa/slhdsa.go.
    try {
      SlhDsaPrivateKey privateKey =
          SlhDsaPrivateKey.createWithoutVerification(
              SlhDsaPublicKey.builder()
                  .setSerializedPublicKey(
                      Bytes.copyFrom(
                          Hex.decode(
                              "B5E6D5EDD09F31333386F4E6B7EDC7668E4DF211802E924300D604FD3C9BAC08")))
                  .setParameters(SlhDsaParameters.createSlhDsaWithSha2And128S(Variant.NO_PREFIX))
                  .build(),
              SecretBytes.copyFrom(
                  Hex.decode(
                      "7C301236E7F265B34DA1500D37332CCBAAB335C49ED15B3239B983CD5A47E558B5E6D5EDD09F31333386F4E6B7EDC7668E4DF211802E924300D604FD3C9BAC08"),
                  InsecureSecretKeyAccess.get()));
      return stream(
          new SignatureTestVector[] {
            new SignatureTestVector(
                privateKey,
                Hex.decode(
                    ""),
                Hex.decode(
                    ""))
          });
    } catch (GeneralSecurityException e) {
      throw new IllegalStateException(e);
    }
  }

  private SlhDsaTestUtil() {}
}
